<p>&nbsp;</p>","additionalTicketText":"GA Seated || Please note, there is a two drink minimum in the room.","ageLimitCode":"OVER_21","ageLimit":"21 and Over","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1349925?utm_medium=api","ticketPrice":"$10.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":1743365,"name":"Henry Jamison","startTime":null,"eventDescription":"Assuming that a pedigree in such things has any relevance at all, which is certainly unclear, Henry Jamison was perhaps predisposed to songwriting. His great-great-great-great-great-great-great (etc.) grandfather was the 14th century poet John Gower (friend to Chaucer and Richard II) and his great-great-great-great grandfather was George Frederick Root, the most popular songwriter of the Civil War era. Probably more relevant is that his mother is an English professor and his father a classical composer, who gave him a Korg 8-track recorder and his first guitar.

Henry attended a Waldorf School near his hometown of Burlington, VT, sang in a traveling folk choir and played viola in local youth orchestras. After an academically turbulent stint as an English major at Bowdoin College in Maine, he left on tour for two years with a band of bearded friends. This period was full of joys and sorrows and ended in a move back home. After a few attempts at recording a solo debut with a cadre of talented players, Henry decided to demo some new ideas on his old Korg 8-track, which would go on to become The Rains EP. These songs show a central interest in exploring inner worlds, observing their treasures and holding none in contempt. They run the gamut from an earnest reckoning with romantic upheaval ("Real Peach"), to a knee-jerk and distorted view of the same ("Through a Glass"), to storm-driven dreamscapes ("The Rains" and "Dallas Love Field"). Finally, in "No One Told Me," Henry stands metaphorically on his own "Galleons Lap" (the summit where Christopher Robin says Goodbye-for-Now to the Hundred Acre Wood in A.A. Milne's House at Pooh Corner) and looks out, with a newfound composure born of relationship, to the horizon of the Who-Knows-What that is the life of a musician.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-atjmbo.jpg","width":960,"height":960},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-atlg.jpg","width":300,"height":300},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-atmd.jpg","width":200,"height":200},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-og.jpg","width":960,"height":960},"small":{"path":"http://cdn.ticketfly.com/i/00/02/33/36/09-ats